void projection_to_plane(int x, int y, float *xf, float *yf) {
	if(x < PIXY_VEC_WIDTH/2) {
		*xf = -orthoX[PIXY_VEC_WIDTH/2 - x - 1][y];
	} else if (x == PIXY_VEC_WIDTH/2 && PIXY_VEC_WIDTH % 2 == 1) {
		*xf = 0;
	} else {
		*xf = orthoX[x - (PIXY_VEC_WIDTH/2+1)][y];
	}
	*yf = orthoY[y];
}


